import React from "react";
import "../css/footer.scss";
import { Container, Row, Col } from "reactstrap";

function Footer(): JSX.Element {
  return (
    <div id="footer" className="padding-top-btm-2e">
      <Container>
        <Row xs={12} sm={12} md={12}>
          <Col></Col>
        </Row>
      </Container>
    </div>
  );
}

export default Footer;
